Provider
Usage Patterns
Basic Authenticated User
For an application with logged-in users, pass the user's unique ID to the
```
userId
```
prop. This ensures that the agent's context is tied to the correct user.
Copy Ask AI
```
import { AgentProvider } from "@inngest/use-agent" ;
import { ChatPage } from "./ChatPage" ;
import { ThreadsSidebar } from "./ThreadsSidebar" ;

function App ({ userId }) {
return (
< AgentProvider userId = { userId } >
< ChatPage />
< ThreadsSidebar />
</ AgentProvider >
);
}
```

Provider
Usage Patterns
Custom Transport Configuration
You can customize the HTTP endpoints and headers used by the transport layer by passing a configuration object to the
```
transport
```
prop. This is useful if your API routes don't follow the default conventions.
Copy Ask AI
```
import { AgentProvider } from "@inngest/use-agent" ;

function App ({ userId , getAuthToken }) {
return (
< AgentProvider
userId = { userId }
transport = { {
api: {
sendMessage: '/api/v2/chat' ,
fetchThreads: '/api/v2/threads'
},
headers : () => ({
'Authorization' : `Bearer ${ getAuthToken () } ` ,
})
} }
>
< ChatApp />
</ AgentProvider >
);
}
```
